import './Header.css'
import '../../App.css'
import HeaderBottom from './HeaderBottom'
import HeaderTop from './HeaderTop'

function Header({searchBook,setSearchBook}) {

  return (
    <div className='header'>
        <HeaderTop 
           searchBook={searchBook}
           setSearchBook = {setSearchBook}
        />
        <HeaderBottom />
    </div>
  )
}

export default Header
